import seaborn as sns
import matplotlib.pyplot as plt
import random

def task_func(list_of_lists, seed=0):
    random.seed(seed)
    data = []
    for sublist in list_of_lists:
        if not sublist:
            data.extend([random.randint(0, 100) for _ in range(5)])
        else:
            data.extend(sublist)
    plt.figure()
    sns.histplot(data, kde=False)
    return plt.gca()
